import { useState } from 'react'
import './App.css'
import { TextField } from '@material-ui/core'

function App() {

  const [searchText, setSearchText] = useState('')
  const onChange = evt => {
    setSearchText(evt.target.value)
  }

  return (
    <div className="App">
      <header className="App-header">
      <TextField
            onChange={onChange}
            value={searchText}
            color='secondary'
            type='search'
            label='search'
            placeholder='...'
          /> {/* text color in App.css: input */}
          <hr />
        <h4>{searchText}</h4>
      </header>
    </div>
  )

}

export default App
